const GenerateImage =()=>{
    var x =0;
    //var url= `https://picsum.photos/id/${x}` ;
    
    setInterval(()=>{
        var url ="https://picsum.photos/333";
        return url;

    },1000)
    return(

        setInterval(()=>{

            return(
                <>
                <img src= "https://picsum.photos/333" alt="xyz"></img>
                </>
            )
        },1000
        )
    )

}

export default GenerateImage;
